function Footer(){
    return(
        <footer>
            <h3>Szkoła językowa - <span>Języki</span></h3>
            <p>Telefon: 564564564</p>
            <p>E-mail: jezyki@gmail.com</p>
        </footer>
    );
}

export default Footer;
